/**
 * 获取Relay状态，这个接口数据从rcMongoServer/relay/GetRelayInfo中获取，不是从monitorMongoServer中取
 */
function getData_callDetail00() {
	$.ajax({
		type : "post",
		url : "allaction.sopRelayStateURL.action",// 此处连接action，获取数据
		dataType : "json",
		data : "",
		beforeSend : function() {
			$(".layer").show();
		},
		complete : function() {
			$(".layer").hide();
		},
		success : function(data) {
			if (data != null) {
				sendDataToView00(data);//“通话详情”中的Relay信息/Relay状态/Relay状态数据
			} 
		},
		error : function(request, textStatus, errorThrown) {
			if (request.status == 900) {
				window.location.href = "login.jsp";
			}
		}
	});
}
/**
 * 整个“通话详情”只需要一个接口来取出所有数据
 */
function getData_callDetail01(sid) {
	$.ajax({
		type : "post",
		url : "allaction.report.action",// 此处连接action，获取数据
		dataType : "json",
		data : "sid=" + sid.substring(0,sid.lastIndexOf('_')),
		beforeSend : function() {
			$(".layer").show();
		},
		complete : function() {
			$(".layer").hide();
		},
		success : function(data) {
			if (data != null) {
				getCallEndTime(data);//设置“通话详情/客户端”非话务的登出时间
				sendDataToView01(data,sid);//“通话详情”
			} 
		},
		error : function(request, textStatus, errorThrown) {
			if (request.status == 900) {
				window.location.href = "login.jsp";
			}
		}
	});
}

